#<HTTParty::Response:0x7fd9f3f59388 parsed_response={"profile"=>"Alternative Rock / Modern Rock band formed in 1987, Aberdeen, WA, United States. Disbanded in 1994.\r\n\r\nConsidered by many to be the leading lights of the Seattle grunge scene of the late 1980s/early 1990s, and perhaps the most influential rock band of Generations X & Y, Nirvana was a powerful trio of musicians who brought a unique aesthetic to a growing-stale rock scene.  They had already made some waves on Sub Pop with their debut, \"[m=13773]\".  But it wasn't until their major-label debut for [l=DGC]/[l=Geffen Records], 1991's \"[m=13814]\" - perhaps, more specifically, the first 30 seconds of \"[m=22439]\" - that they broke into the mainstream of America - not really because they wanted to. Lead singer frontman [a=Kurt Cobain]'s death (suspected suicide) in April 1994 brought an untimely end to the band. Drummer [a=Dave Grohl] went on to form the [a=Foo Fighters].  In the fall of 2004, \"[m=42482]\" (a 3-CD/DVD set of mostly unreleased material) confirmed that interest in the band is still very high. Most young rock stars today will likely cite Nirvana as a major influence on them.\r\n", "releases_url"=>"https://api.discogs.com/artists/125246/releases", "name"=>"Nirvana", "uri"=>"https://www.discogs.com/artist/125246-Nirvana", "members"=>[{"active"=>false, "resource_url"=>"https://api.discogs.com/artists/455772", "id"=>455772, "name"=>"Aaron Burckhard"}, {"active"=>false, "resource_url"=>"https://api.discogs.com/artists/251654", "id"=>251654, "name"=>"Chad Channing"}, {"active"=>false, "resource_url"=>"https://api.discogs.com/artists/261337", "id"=>261337, "name"=>"Dale Crover"}, {"active"=>false, "resource_url"=>"https://api.discogs.com/artists/252301", "id"=>252301, "name"=>"Dan Peters"}, {"active"=>true, "resource_url"=>"https://api.discogs.com/artists/203017", "id"=>203017, "name"=>"Dave Grohl"}, {"active"=>true, "resource_url"=>"https://api.discogs.com/artists/975603", "id"=>975603, "name"